import React from 'react';
import './App.css';

function MyBlog()
{
      let str = "aaaaaaaaaaas dddddddd fffffffffffff ssssssssss ffffffffffffffffff     rrrrrrrrrrrrrrrrrrrrrrrr rrrrrrrrrrrrrrrrrrrrrrrr rrrrrrrrrrrrrrrrr"
      return (
         <>
        <div class="Blog">
         <div style={{backgroundColor:'white'}}>
            {str}
         </div>

         <div style={{backgroundColor:'white'}}>
            {str}
         </div>

         <div style={{backgroundColor:'white'}}>
            {str}
         </div>
          
          {/* <p class="email">
            <input name="email" type="text" class="validate[required,custom[email]] feedback-input" id="Categorized" placeholder="Categorized" />
          </p>
          
          <p class="text">
            <textarea name="text" class="validate[required,length[6,300]] feedback-input" id="comment" placeholder="Comment"></textarea>
          </p> */}
          
      </div>
      </>
      )
}

export default MyBlog;
